import React, { useEffect, useState } from "react";
import axios from "axios";

const categories = ["house", "room", "sofa", "bathroom"];

const Services = () => {
  const [selectedCategory, setSelectedCategory] = useState("house");
  const [services, setServices] = useState([]);
  const [loading, setLoading] = useState(false);
  const [error, setError] = useState("");

  const fetchServices = async (category) => {
    setLoading(true);
    setError("");
    try {
      const response = await axios.get(
        `http://localhost:7001/api/auth/services/${category}`
      );

      if (Array.isArray(response.data)) {
        setServices(response.data);
      } else if (
        response.data.services &&
        Array.isArray(response.data.services)
      ) {
        setServices(response.data.services);
      } else {
        setServices([]);
        setError("Unexpected API response format");
      }
    } catch (err) {
      setError("Failed to fetch services");
      console.error(err);
    } finally {
      setLoading(false);
    }
  };

  useEffect(() => {
    fetchServices(selectedCategory);
  }, [selectedCategory]);

  return (
    <div className="container">
      <div className="row">
        <div className="p-6 max-w-6xl mx-auto">
          <h1 className="text-4xl font-extrabold mb-8 text-center text-gray-900 tracking-wide">
            Our Services
          </h1>

          <div className="mb-8 flex justify-center">
            <select
              className="p-3 border border-gray-300 rounded-lg text-lg font-medium text-gray-700 
                     focus:outline-none focus:ring-2 focus:ring-blue-500 focus:border-transparent
                     transition duration-300"
              value={selectedCategory}
              onChange={(e) => setSelectedCategory(e.target.value)}
              aria-label="Select service category"
            >
              {categories.map((cat) => (
                <option key={cat} value={cat}>
                  {cat.charAt(0).toUpperCase() + cat.slice(1)} Service
                </option>
              ))}
            </select>
          </div>

          {loading ? (
            <p className="text-center text-xl text-gray-600 animate-pulse">
              Loading...
            </p>
          ) : error ? (
            <p className="text-center text-red-600 font-semibold text-lg">
              {error}
            </p>
          ) : services.length === 0 ? (
            <p className="text-center text-gray-500 text-lg">
              No services found for{" "}
              <span className="font-semibold">{selectedCategory}</span>
            </p>
          ) : (
            <div className="grid gap-8 grid-cols-1 sm:grid-cols-2 lg:grid-cols-3">
              {services.map((service) => (
                <div
                  key={service._id || service.service || Math.random()}
                  className="bg-white rounded-xl shadow-lg overflow-hidden hover:shadow-2xl
                         transition-shadow duration-300 cursor-pointer flex flex-col"
                  tabIndex={0}
                  role="article"
                  aria-label={`${
                    service.type || service.service || "Service"
                  } details`}
                >
                  <img
                    src="https://via.placeholder.com/400x200?text=Service+Image"
                    alt={service.service || service.type || "Service image"}
                    className="w-full h-48 object-cover"
                  />

                  <div className="p-6 flex flex-col flex-grow">
                    {selectedCategory === "house" ? (
                      <>
                        <h2 className="text-2xl font-semibold mb-3 text-gray-900">
                          {service.type || "Untitled Service"}
                        </h2>
                        <p className="text-gray-700 mb-4 flex-grow">
                          {service.description || "No description provided."}
                        </p>
                        <div className="text-gray-800 font-semibold space-y-1">
                          <p>
                            <span className="font-semibold">
                              Furnished Price:
                            </span>{" "}
                            ₹
                            {service.furnished !== undefined
                              ? service.furnished
                              : "N/A"}
                          </p>
                          <p>
                            <span className="font-semibold">
                              Unfurnished Price:
                            </span>{" "}
                            ₹
                            {service.unfurnished !== undefined
                              ? service.unfurnished
                              : "N/A"}
                          </p>
                        </div>
                      </>
                    ) : (
                      <>
                        <h2 className="text-2xl font-semibold mb-3 text-gray-900">
                          {service.service || "Untitled Service"}
                        </h2>
                        <p className="text-gray-700 mb-4 flex-grow">
                          {service.description || "No description provided."}
                        </p>
                        <p className="text-gray-800 font-semibold">
                          Price: ₹
                          {service.price !== undefined ? service.price : "N/A"}
                        </p>
                      </>
                    )}
                  </div>
                </div>
              ))}
            </div>
          )}
        </div>
      </div>
    </div>
  );
};

export default Services;
